import{_ as a,c as t,o,ag as i}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"DROP INDEX","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_INDEX.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_INDEX.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_INDEX.md"};function n(d,e,c,r,l,p){return o(),t("div",null,e[0]||(e[0]=[i('<h1 id="drop-index" tabindex="-1">DROP INDEX <a class="header-anchor" href="#drop-index" aria-label="Permalink to &quot;DROP INDEX&quot;">​</a></h1><p>Removes an index.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP INDEX [ CONCURRENTLY ] [ IF EXISTS ] &lt;name&gt; [, ...] [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP INDEX</code> drops an existing index from the database system. To run this command you must be the owner of the index.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>CONCURRENTLY : Drop the index without locking out concurrent selects, inserts, updates, and deletes on the index&#39;s table. A normal <code>DROP INDEX</code> acquires an <code>ACCESS EXCLUSIVE</code> lock on the table, blocking other accesses until the index drop can be completed. With this option, the command instead waits until conflicting transactions have completed.</p><p>: There are several caveats to be aware of when using this option. Only one index name can be specified, and the <code>CASCADE</code> option is not supported. (Thus, an index that supports a <code>UNIQUE</code> or <code>PRIMARY KEY</code> constraint cannot be dropped this way.) Also, regular <code>DROP INDEX</code> commands can be performed within a transaction block, but <code>DROP INDEX CONCURRENTLY</code> cannot.</p><p>IF EXISTS : Do not throw an error if the index does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of an index to remove.</p><p>CASCADE : Automatically drop objects that depend on the index, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the index if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the index <code>title_idx</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP INDEX title_idx;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP INDEX</code> is a WarehousePG language extension. There are no provisions for indexes in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_INDEX.html">ALTER INDEX</a>, <a href="./CREATE_INDEX.html">CREATE INDEX</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',21)]))}const m=a(s,[["render",n]]);export{u as __pageData,m as default};
